const initialData={
    cars:[{
        image:"https://carwow-uk-wp-3.imgix.net/18015-MC20BluInfinito-scaled-e1666008987698.jpg",
        name:"masserati",
        rentPerHour:"50dt"
    }]
}
export const carsReducer=(state={initialData},action)=>{
    switch(action.type){
        case 'GET_ALL_CARS':{
            return{
                ...state,
                cars:action.payload
            }
        }
        default:return state
    }
}
